import React from 'react';
import CountdownCircle from 'react-native-countdown-circle';

function Circularcount() {
  return (
      <CountdownCircle
        seconds={10}
        radius={30}
        borderWidth={8}
        color="#ff003f"
        bgColor="#fff"
        textStyle={{ fontSize: 20 }}
        onTimeElapsed={() => console.log('Elapsed!')}
      />
  );
}

export default Circularcount;
